                <h1 className="mb-5">Trouvez votre prestataire</h1>
                <span className="text-secondary">Chez Shiny nous r√©unissons les meilleurs profils pour vous.</span>
            </div>
            <div id="cards" className="row d-flex justify-content-center mt-5">
                {freelanceProfiles.map((profile, index) => (
                    <Card
                        key={`${profile.name}-${index}`}
                        label={profile.jobTitle}
                        picture={profile.picture}
                        title={profile.name}
                    />
                ))}
            </div>
        </div>
    )
}

export default Freelances;
